script: |
  super -f text -I q10655.spq | sort > q10655.out

inputs:
  - name: q10655.spq
    data: |
      SELECT DISTINCT - 34 / col2 + col2 + ( - col1 ), - 97 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE NOT - col2 IS NULL;
  - name: tab0

outputs:
  - name: q10655.out
    data: |
      -14	-97
      -34	-97
      98	-97
